{"title":"Trafficlight -- coloring based on value in the index","type":"vega","params":{"spec":"{
  # Schema indicates that this is Vega code
  $schema: "https://vega.github.io/schema/vega/v3.0.json"
  # All our data sources are listed in this section
  data: [
    {
      name: "values"
      # when url is an object, it is treated as an Elasticsearch query
      # This query searches for the last value in the index. Could be optimized by sorting. You also can define aggregations here. But the access to the results is a bit different than
      url: {
        index: fxtest
        body: {
          query: {
            match_all: {}
          }
          size: 1
        }
      }
      # We only need a specific array of values from the response
      format: {property: "hits.hits"}
    }
  ]
  # Marks is a list of all drawing elements.
  # For this graph we need to have the background rectangle with an including text
  marks: [
    {
      type: group
      marks: [
        {
          type: rect
          from: {data: "values"}
      # Text mark executes once for each of the values in the results,
      # but results has just one value in it. We could have also used it
      # to draw a list of values.
          encode: {
            update: {
          # Decide which background color to set based on the a target and an output value
              fill: {
                signal: if( datum._source.target < datum._source.output, '#00ff00', '#ff0000')
              }
          # Lets fill the whole background with the rectangle 
              width: {signal: "width"}
              height: {signal: "height"}

          #Also define a link to click on -- need to be enabled in kiban.yml
              href: {value: "http://google.de"}
            }
          }
        }
        {
          type: text
          from: {data: "values"}
      # Text mark executes once for each of the values in the results,
      # but results has just one value in it. We could have also used it
      # to draw a list of values.
          encode: {
            update: {
          # Define output field
              text: {field: "_source.output"}

          # positioning the text in the center of the window
              align: {value: "center"}
              baseline: {value: "middle"}
              x: {signal: "width/2"}
              y: {signal: "height/2"}
          # Make the size of the font adjust with the size of the visualization
              fontSize: {signal: "min(width/10, height)/1.3"}
            }
          }
        }
      ]
    }
  ]
}"},"aggs":[]}

